import bann from "./Assets/63915074368c9d1a0e933ed8_coffe_shop_interior_1.jpg"
const Banniere = () => {
    return ( <div>
        <img src={bann} className="relative z-1 w-full"></img>
        <button class="z-10 absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 bg-blue-500 text-white px-4 py-2">Login </button>
    </div> );
}
 
export default Banniere;
